import React from "react";

import "./styles.css";

import HeaderComponent from "../../components/Header";
import BannerComponent from "../../components/Banner";
import FooterComponent from "../../components/Footer";
import ListJobsComponent from "../../components/ListJobs";
// import StartCTAComponent from "../../StartCTA";

const Home = () => {
  return (
    <div>
      <HeaderComponent />

      <BannerComponent />

      {/* <StartCTAComponent /> */}
      <section class="section">
        <div class="container">
          <div class="row justify-content-center">
            <div class="col-lg-7">
              <div class="text-center">
                <h2 class="mb-4">
                  Navegue Por Nossas{" "}
                  <span class="text-warning fw-bold">150+</span> Vagas
                </h2>
                <p class="text-muted">
                  Publique um trabalho para nos contar sobre seu projeto. Iremos
                  rapidamente combin√°-lo com os freelancers certos.
                </p>
              </div>
            </div>
          </div>
        </div>
      </section>

      <ListJobsComponent />

      <FooterComponent />
    </div>
  );
};

export default Home;
